import React, { Component } from 'react';
import { InfoContainer, Info, Portrait } from './styles';

export default function Content() {
  return (
    <InfoContainer>
      <Info>
        You're probably visiting this page because of the article written by my good friend <a style = {{
          fontStyle: 'italic',
          color: 'black'
        }} href="https://github.com/csinozich/">Claire</a>.<br/><br />
        Thank you for being here, and welcome to my 'about' section. I'd like to give a full bio, but there's not much to me.<br /><br />
        I'm a freelance web designer, a student, and a Javascript fanatic. If you'd like to collaborate on a project, feel free to send me an email.<br /><br />
        Otherwise, forgive me for having my website under construction at a time like this. I got caught up working on a <a href="www.douglasjordan.me/dragdrop">Drag and Drop Library</a> that I forgot to maintain a presentable portfolio.
      </Info>
      <Portrait />
    </InfoContainer>
  )
}
